"use strict";

var _helpers = require("./helpers");

it('px helper works', () => {
  expect((0, _helpers.convertToPx)(1)).toBe(16);
});
it('rotate helper works', () => {
  expect((0, _helpers.rotateDegree)(12)).toBe(30);
});
it('joins non-empty classnames', () => {
  const className = (0, _helpers.clsx)('', 'first', '', 'second', '', undefined, '');
  expect(className).toBe('first second');
});